import { SafeAreaView, StyleSheet, View } from "react-native";

import HabitPage from "./components/HabitPage";

export default function App() {
  return (
    <View style={{ flex: 1 }}>
      <SafeAreaView></SafeAreaView>
      <HabitPage></HabitPage>
    </View>
  );
}

const styles = StyleSheet.create({});
